INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(1, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Lobby is the starting point of every Quest. In the lobby heroes can shop and heal.', 'Lobby', 'https://res.cloudinary.com/celik/image/upload/v1608567731/lobby_wqpd5m.png', 1);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(2, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'You know that Orb you have been searching for? Well, its here. But wait, you need to have the key first. Even if you have the key, be prepared, you need to fight hard for the Orb!', 'Boss Room', 'https://res.cloudinary.com/celik/image/upload/v1608567894/dragon_boss_dxepjy.png', 2);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(3, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'As you enter this cave, all bats exit. Maybe there is a monster here?', 'Stone Cave', 'https://res.cloudinary.com/celik/image/upload/v1608568036/cave_joofgm.jpg', 3);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(4, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'This cave is endless! There could be some secret items, but monsters as well!', 'Deep Cave', 'https://res.cloudinary.com/celik/image/upload/v1608568037/cave2_b0s2c5.jpg', 3);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(5, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'There is a lot of clay here, but are there any monsters?', 'Clay Cave', 'https://res.cloudinary.com/celik/image/upload/v1608568036/cave3_qaavlv.jpg', 3);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(6, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'This is truly beautiful sight. Lonely barn located in the middle of the farm. Should I look inside?', 'Barn Field', 'https://res.cloudinary.com/celik/image/upload/v1608568266/barn_p6ayko.jpg', 4);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(7, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Beautiful view of the mountains, but there could be danger near!', 'Mountain Vista', 'https://res.cloudinary.com/celik/image/upload/v1608568266/field_rrbxen.png', 4);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(8, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'The park is a place to relax, but it could also be a place where a monster hides!', 'Park', 'https://res.cloudinary.com/celik/image/upload/v1608568267/field2_gr3uyj.jpg', 4);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(9, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'There are a lot of birds in the area. Maybe there are no monsters here?', 'Bird Lake', 'https://res.cloudinary.com/celik/image/upload/v1608568553/lake_czllfw.jpg', 5);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(10, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'As you enter the woods, you get really thirsty, but then you see the lake!', 'Woods Lake', 'https://res.cloudinary.com/celik/image/upload/v1608568554/lake2_ckosbn.jpg', 5);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(11, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Imagine living here! There is house next to this lake. I should search for items inside the house!', 'House Lake', 'https://res.cloudinary.com/celik/image/upload/v1608568553/lake3_man85p.jpg', 5);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(12, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'A huuuge lake in front! I should go for a swim.', 'Lake Valley', 'https://res.cloudinary.com/celik/image/upload/v1608568552/lake4_tqpgqa.jpg', 5);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(13, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'This river name is in some slavic language and it looks amazing. I should defend this place of any evil', 'Babina Rijeka', 'https://res.cloudinary.com/celik/image/upload/v1608568933/river_q0baud.jpg', 6);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(14, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'This lake is wide as Amazon river. Locals used to call it a Lake. Maybe I will find some interesting items here', 'River Lake', 'https://res.cloudinary.com/celik/image/upload/v1608568933/river2_f4swau.jpg', 6);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(15, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'It is dark and foggy, although the sun shines. There are no frogs or any other creatures', 'Green Swamp', 'https://res.cloudinary.com/celik/image/upload/v1608569151/swamp_jtma0w.jpg', 7);
INSERT INTO game.dungeon(id, created_on, modified_on, description, name, photoUrl, dungeontype_id)
VALUES(16, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'There are a lot of butterflies here, and there is sunshine on flowers, no monster would like to be here, right?', 'Magic Swamp', 'https://res.cloudinary.com/celik/image/upload/v1608569151/swamp2_hx4w5o.jpg', 7);

